import React from 'react';
import Select from 'react-select/animated';

const options = [
    {value: "fiction", label: "Fiction", isPicked: false},
    {value: "non-fiction", label: "Non-fiction", isPicked: false},
    {value: "mystery", label: "Mystery", isPicked: false}
]

function GenreOptions () {
    return (
        <Select 
            isMulti 
            options={options} />
    )
}

export default GenreOptions
